{% for k, v in entry.items()%}
{%if k in vars.poeple_fields_filter%}
{{_entry.update({k:v})}}
{%endif%}
{%endfor%}
{{_entries.append(_entry)}}
{%endfor%}
{%if _entries|length > 0%}
{{vars.json_tables.append(["Relevant Contacts",_entries])}}
{%endif%}

